import React from "react";
import { Jumbotron } from "react-bootstrap";


export default function About() {
  return (
    <Jumbotron>
      <h1>Soy el about</h1>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis sed
        dapibus leo, eget posuere eros. Suspendisse potenti. In non lacinia
        tellus. Vestibulum efficitur hendrerit mauris, ut facilisis ligula
        cursus vitae. Nullam auctor felis at eros ullamcorper, at rutrum justo
        efficitur.
      </p>
    </Jumbotron>
  );
}



